import { GET_USERDATA } from "../action-types/user-types";
const initialState = {
    username: "",
    password: "",
};

const UserData = (state=initialState, action) => {
    switch(action.type){
        case GET_USERDATA:
            return {...state, userData:action.payload};
        default: 
        return state;
    }
}

export default UserData;
